res = []
    for i in range(len(LETTERS) - n + 1):
        for letter in itertools.combinations(LETTERS, n):
            res.append(letter)
    with open("letter_combinations_{}.json".format(random.randint(0, 100)), "w") as json_file:
        json.dump(res, json_file)
        return "letter_combinations_{}.json".format(random.randint(0, 100))

combination = []
    for i in range(1, n+1):
        combination.append(itertools.combinations(LETTERS, i))
    count_dict = {}
    for i in range(0, n):
        count_dict[i] = defaultdict(int)
    for j in itertools.chain(*combination):
        for k in j:
            count_dict[i][k] += 1

    # Save the result as a JSON file
    file_name = f"letter_combinations_{random.randint(0, 100)}.json"
    with open(file_name, 'w') as file:
        json.dump(count_dict, file, indent=4)
    return file_name
